router.get('/', async (req, res) => {
	const token = req.query.token;

	const link = await links.findOne({ where: { token: token } });

	if (!link) return res.status(401).send(new Error('The link has expired'));
	else await links.destroy({ where: { email: link.email, token: token } });

	await users.increment('authorized', { by: 1, where: { email: link.email } });
	const user = await users.findOne({ where: { email: link.email } });

	const sID = sign({ name: user.name, sex: user.sex, country: user.country, address: user.address, number: user.number, email: user.email, invites: user.invites, authorized: user.authorized, banned: user.banned, live: user.live }, 'salt');
	res.status(202).send(sID);
});

router.get('/auth', validate, (req, res) => {
	res.json(req.user);
});

router.get('/orders/:email', async (req, res) => {
	const ordersDB = await orders.findAll({ where: { email: req.params.email } });
	if (!ordersDB) return res.status(404).send('Not found');
	res.status(200).send(ordersDB);
});

router.patch('/', async (req, res) => {
	const user = req.body;

	const userDB = await users.findOne({ where: { email: user.email } });
	if (!userDB) await users.create(user);
	else await userDB.update(user);

	res.status(200).send(user.name);
});

module.exports = router;